import React, { useEffect } from "react";
import "./styles.css";
import { useDispatch, useSelector } from "react-redux";
import { fetchNewsBegin } from "../../redux/News/actions";
import { getNews } from "../../redux/News/selectors";
import PostItem from "../../Components/PostItem";
import Pagination from "../../Components/Pagination";
import { bookMarked } from "../../redux/Bookmarks/selectors";

const Bookmarks = () => {
  const dispatch = useDispatch();
  const bookmarked = useSelector(bookMarked);

  useEffect(() => {
    dispatch(fetchNewsBegin());
  }, []);

  return (
    <div className="container">
      <div className="row">
        <div className="col-xl-12 col-lg-12 col-md-8">
          <div className="row">
            {bookmarked.slice(1, 9).map((data, index) => (
              <div
                key={index}
                className="col-xl-3 col-lg-6 col-md-10 col-sm-6 pb-4"
              >
                <PostItem postData={data} />
              </div>
            ))}
          </div>
        </div>
        <Pagination />
      </div>
    </div>
  );
};

export default Bookmarks;
